import React from "react";
import NavItem from "./nav-item/Nav-item.component";
import "./Navbar.styles.scss";
import 'materialize-css/dist/css/materialize.min.css'

import M from 'materialize-css';

class Navbar extends React.Component {
  componentDidMount(){
    M.Sidenav.init(this.sidenav);

  }
  render(){
    const navItems = ["Home", "Resume", "Portfolio", "Contact", "Shop"];

  return (
    // <div className = 'nav-bar' style = {{display:'flex', justifyContent: 'space-evenly', backgroundColor:'#563d7c'}}>
    //     {navItems.map(ele=><NavItem item = {ele}/>)}

    // </div>
    <div>
      <nav>
        <div class="nav-wrapper">

          <a data-target="mobile-demo" class="sidenav-trigger">
            <i class="material-icons">menu</i>
          </a>
          <ul class="right hide-on-med-and-down">
           {navItems.map(ele=><NavItem item = {ele}/>)}


          </ul>
        </div>
      </nav>

      <ul class="sidenav" id="mobile-demo">
      {navItems.map(ele=><NavItem item = {ele}/>)}

      </ul>
    </div>
  );
  }
};

export default Navbar;
